                        if PFdetails /= undefined, NFdetails /= undefined -> 'erlang_++'(PFdetails, NFdetails, TrUserData);
                           PFdetails == undefined -> NFdetails;
                           NFdetails == undefined -> PFdetails
                        end,
                    f2 =
                        if NFf2 =:= undefined -> PFf2;
                           true -> NFf2
                        end,
                    f3 =
                        if NFf3 =:= undefined -> PFf3;
                           true -> NFf3
                        end,
