verify_msg(Msg) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), []);
verify_msg(X) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) -> verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 -> verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) -> mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
        'ServerDetails' -> v_msg_ServerDetails(Msg, [MsgName], TrUserData);
        'ServersType1' -> v_msg_ServersType1(Msg, [MsgName], TrUserData);
        'ServerConnectionDetailsWrapper' -> v_msg_ServerConnectionDetailsWrapper(Msg, [MsgName], TrUserData);
        'ServersType2' -> v_msg_ServersType2(Msg, [MsgName], TrUserData);
        'TCPServerInfo' -> v_msg_TCPServerInfo(Msg, [MsgName], TrUserData);
        'TCPHello' -> v_msg_TCPHello(Msg, [MsgName], TrUserData);
        'RecurringTCPResponse' -> v_msg_RecurringTCPResponse(Msg, [MsgName], TrUserData);
        _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_ServerDetails/3}).
-dialyzer({nowarn_function,v_msg_ServerDetails/3}).
v_msg_ServerDetails(#'ServerDetails'{f1 = F1, f2 = F2, ip = F3, port = F4}, Path, TrUserData) ->
    v_type_int32(F1, [f1 | Path], TrUserData),
    v_type_int32(F2, [f2 | Path], TrUserData),
    v_type_string(F3, [ip | Path], TrUserData),
    v_type_int32(F4, [port | Path], TrUserData),
    ok;
v_msg_ServerDetails(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'ServerDetails'}, X, Path).

-compile({nowarn_unused_function,v_msg_ServersType1/3}).
-dialyzer({nowarn_function,v_msg_ServersType1/3}).
v_msg_ServersType1(#'ServersType1'{details = F1, f2 = F2, f3 = F3, f4 = F4}, Path, TrUserData) ->
    if is_list(F1) ->
           _ = [v_msg_ServerDetails(Elem, [details | Path], TrUserData) || Elem <- F1],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'ServerDetails'}}, F1, [details | Path])
    end,
    if F2 == undefined -> ok;
       true -> v_type_int32(F2, [f2 | Path], TrUserData)
    end,
    if F3 == undefined -> ok;
       true -> v_type_int32(F3, [f3 | Path], TrUserData)
    end,
    if F4 == undefined -> ok;
       true -> v_type_int32(F4, [f4 | Path], TrUserData)
    end,
    ok;
v_msg_ServersType1(X, Path, _TrUserData) -> mk_type_error({expected_msg, 'ServersType1'}, X, Path).

