-compile({nowarn_unused_function,v_msg_ServersType2/3}).
-dialyzer({nowarn_function,v_msg_ServersType2/3}).
v_msg_ServersType2(#'ServersType2'{details_wrapper = F1, port = F2}, Path, TrUserData) ->
