-compile({nowarn_unused_function,v_msg_TCPServerInfo/3}).
-dialyzer({nowarn_function,v_msg_TCPServerInfo/3}).
v_msg_TCPServerInfo(#'TCPServerInfo'{f1 = F1, player_id = F2, f3 = F3, servers = F4, other_servers = F5}, Path, TrUserData) ->
    if F1 == undefined -> ok;
