           _ = [v_msg_ServersType1(Elem, [servers | Path], TrUserData) || Elem <- F4],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'ServersType1'}}, F4, [servers | Path])
    end,
    if is_list(F5) ->
           _ = [v_msg_ServersType2(Elem, [other_servers | Path], TrUserData) || Elem <- F5],
           ok;
       true -> mk_type_error({invalid_list_of, {msg, 'ServersType2'}}, F5, [other_servers | Path])
